import React from 'react';

class ViewBuilding extends React.Component {

	render() {
		const { data, building } = this.props;
		var tmp = data[building];

		for(var propName in tmp) {
		    var propValue = tmp[propName]
		    console.log(propName,propValue);
		}
		return (
			<div>
				<p>
					<tr key={tmp.id} >
					<tr>{tmp.code} </tr>
					<tr> {tmp.name} </tr>
					<tr> {tmp.address} </tr>
					<tr> {tmp.coordinates.lat} </tr>
					<tr> {tmp.coordinates.lng} </tr>
					</tr>
				</p>
			</div>
		);
	}
}
export default ViewBuilding;
